import Card from "./Card"
function Cards(){
    const [elements, setElements] = useState([
    { id: 1, img: "/img/1" , stat: ""},
    { id: 1, img: "/img/1" , stat: ""},
    { id: 2, img: "/img/2" , stat: ""},
    { id: 2, img: "/img/2" , stat: ""},
    { id: 3, img: "/img/3" , stat: ""},
    { id: 3, img: "/img/3" , stat: ""},
    { id: 4, img: "/img/4" , stat: ""},
    { id: 4, img: "/img/4" , stat: ""},
    { id: 5, img: "/img/5" , stat: ""},
    { id: 5, img: "/img/5" , stat: ""},
    ])

    
    return(
    <div className="container">      
        { elements.map((element, index) => (
            <Card  key={index} element={element} 
            />
        ))}
     </div>
    )
}

export default Cards
